    const [Prent,setRent] = useState(0)
    const [Pdetails,setDetails] = useState("")

    const postdata = () =>{
        let api_data = {
            name: Pname,
            address: Paddrs,
            rent: Prent,
            property_details: Pdetails,
        }

        const res = axios({
            method: 'post',
            url: 'https://63610b45af66cc87dc21409b.mockapi.io/property_data',
            data: api_data
        })
        // console.log("HElloooooooo....")
        return res;
    }

    const handleSubmit=(e)=>{
        // e.preventDefault();
        createAccount()
