        name: Pname,
        address: Paddrs,
        rent: Prent,
        property_details: Pdetails,
    }

      //handle Signup API Integration here
      const createAccount= async()=>{
        try {
          let response = await axios.post('https://63610b45af66cc87dc21409b.mockapi.io/property_data', apiData);
          let data = response.data.data;
          let headers = response.headers;
          console.log(response);
        //   await storeData(data, headers);
        }
        catch (error) {
          alert(error.response.data.errors.full_messages[0])
        }
      }

    return (
        <>
        <h1>Create page</h1>
        <form onSubmit={handleSubmit()}>
            <pre>
                <tr>Name of Property   : <input onChange={(e) => setName(e.target.value)} placeholder="Property Name"/></tr><br/>
                <tr>Adress of Property : <input onChange={(e) => setAddrs(e.target.value)} placeholder="Property Adress"/></tr><br/>
                <tr>Property Rent      : <input onChange={(e) => setRent(e.target.value)} placeholder="Property Rent"/></tr><br/>
                <tr>Property Details   : <input onChange={(e) => setDetails(e.target.value)} placeholder="Property Details"></input></tr><br/>

